import { createContext } from "react";
import Component1 from "./Component1";



function App() {

  const context = createContext();
  const user = "Ashutosh";

  return (
    <div className="App">
      <context.Provider value={user}>
        <h1>APP component</h1>
        <Component1 />
      </context.Provider>
    </div>
  );
}

export default App;
